Let Z\overset {h,k}{\rightrightarrows } P be parallel arrows such that \pi _Ch = \pi _Ck. Then
  f\pi _b h = g\pi _c h = g\pi _c k = f\pi _b k, so since f is monic, \pi _b   h = \pi _b k. Now the universal property of the pullback says
  that there is a unique morphism Z\to  P completing the diagram




    \usepackage{tikz, tikz-cd, mathtools, amssymb}
  \usetikzlibrary{shapes.geometric}
  \usetikzlibrary{calc}
  \usetikzlibrary{matrix}
  \usetikzlibrary{decorations.markings}

  \tikzset{
    % basics
    square/.style={draw, regular polygon, regular polygon sides=4},
    triangle/.style={draw, regular polygon, regular polygon sides=3},
  }

  \tikzset{
    % string diagrams
    state/.style={triangle, shape border rotate=180, anchor=north},
    costate/.style={triangle, anchor=south},
    morphism/.style={draw, rectangle},
    over/.style={
      draw=white,
      double=black,
      % default is .4pt
      line width=1.2pt,
      double distance=.4pt,
      text=black
    },
  }

  \tikzset{ 
    % tables
    % https://tikz.net/tikz-table/
    table/.style={
        matrix of nodes,
        row sep=-\pgflinewidth,
        column sep=-\pgflinewidth,
        nodes={
            rectangle,
            draw=black,
            align=center
        },
        minimum height=1.5em,
        text depth=0.5ex,
        text height=2ex,
        nodes in empty cells,
%%
        every even row/.style={
            nodes={fill=gray!20}
        },
        column 1/.style={
            nodes={font=\bfseries}
        },
        row 1/.style={
            nodes={
                fill=black,
                text=white,
                font=\bfseries
            }
        }
    }
  }


    \begin {tikzcd}
      Z\ar [ddr, "\pi _B k = \pi _B h"', bend right]\ar [drr, "\pi _C k = \pi _C h", bend left]\ar [dr, "\exists  !", dashed] \\
      & P\ar [r, "\pi _C"]\ar [d, "\pi _B"']\ar [dr, phantom, "\lrcorner ", very near start] & C\ar [d, "g"] \\
      & B\ar [r, "f"'] & A\makebox [0pt][l]{,}
    \end {tikzcd}


 but h and k both do so, so h = k.

Pullbacks preserve monomorphisms.
